import logo from './logo.svg';
import './App.css';
import Login from './components/Login'
import Header from './components/Header'

function App() {
  return (
    <div className="App">
      <Header />
      <img src={logo} className="App-logo" alt="logo" />
      <Login />
    </div>
  );
}

export default App;
